import React from 'react'

const Map = ({center, map, zoom}) => {
  const mapRef = React.useRef()
  if(window !== undefined){
    const map = new window.SVGFEMorphologyElement.maps.Map(mapRef.current,{
      center,
      zoom
    })
    new window.google.maps.Marker({position: center, map})
  }
  return (
    <div>

    </div>
  )
}

export default Map
